import React, { useState, useEffect } from "react";
import "./card.css";
import { Tooltip } from "@material-ui/core";
import axios from "axios";
import SwiperCore, { Navigation, Pagination } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper.min.css";
import "swiper/swiper-bundle.min.css";



SwiperCore.use([Navigation, Pagination]);

const Card = () => {
  const [topAlbums, setTopAlbums] = useState([]);
  const [newAlbums, setNewAlbums] = useState([]);
  const [expanded, setExpanded] = useState(false);

  useEffect(() => {
    fetchTopAlbums();
    fetchNewAlbums();
  }, []);

  const fetchNewAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/new"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setNewAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching new albums:", error);
    }
  };

  const fetchTopAlbums = async () => {
    try {
      const response = await axios.get(
        "https://qtify-backend-labs.crio.do/albums/top"
      );
      const simplifiedData = response.data.map((album) => ({
        id: album.id,
        image: album.image,
        follows: album.follows,
        title: album.title,
      }));
      setTopAlbums(simplifiedData);
    } catch (error) {
      console.error("Error fetching top albums:", error);
    }
  };

  const handleToggleExpand = () => {
    setExpanded(!expanded);
  };

  return (
    <div className="grid">
      <div className="heading1">
        <div>Top Albums</div>
        {topAlbums.length > 7 && (
          <div onClick={handleToggleExpand} className="headingSub">
            {expanded ? "Collapse" : "Show All"}
          </div>
        )}
      </div>

      <div className="card-container">
        <Swiper
          slidesPerView={2}
          navigation
          pagination={{ clickable: true }}
          className="swiper-container"
        >
          {topAlbums.map((album) => (
            <SwiperSlide key={album.id} className="swiper-slide">
              <div className="card">
                <Tooltip title={`${65} Songs`} placement="top">
                  <img src={album.image} alt="cardImg" />
                </Tooltip>
                <div>
                  <p className="card-follows">{album.follows} Follows</p>
                </div>
                <p className="card-title">{album.title}</p>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>

      <div className="heading1">New Albums</div>
      {newAlbums.length > 7 && (
        <div onClick={handleToggleExpand} className="headingSub">
          {expanded ? "Collapse" : "Show All"}
        </div>
      )}
      <div className="card-container">
        <Swiper
          slidesPerView={1}
          navigation
          pagination={{ clickable: true }}
          className="swiper-container"
        >
          {newAlbums.map((album) => (
            <SwiperSlide key={album.id} className="swiper-slide">
              <div className="card">
                <Tooltip title={`${65} Songs`} placement="top">
                  <img src={album.image} alt="cardImg" />
                </Tooltip>
                <div>
                  <p className="card-follows">{album.follows} Follows</p>
                </div>
                <p className="card-title">{album.title}</p>
              </div>
            </SwiperSlide>
          ))}
        </Swiper>
      </div>
    </div>
  );
};

export default Card;
